      <iframe 
        src="https://mywebar.com/p/Project_0_qbtprz8dtu" 
        width="100%" 
        height="100%" 
        style={{ border: 'none' }} 
        title="AR Content"
      ></iframe>
    </div>
    </div>
  );
}

export default ViewAr;
